description:
Hunt vs Lauda: F1's Greatest Racing Rivals

Technology Documentary hosted by Ed Stoppard, published by BBC in 2013 - English narration


Information
------------------------------

James Hunt has never been equalled. Could swashbuckling Hunt catch the scientific Niki Lauda? Could Niki overcome an appalling crash to come back from the dead and fight James all the way to the last race of the season?
This powerful story captures the heart of the 1970s, told through unseen footage and exclusive interviews with the people who were really there - the team managers, families, journalists and friends who were in the front row of the season that changed Formula 1 forever.

